import React, { useState, useEffect } from 'react';
import { Container, Row, Col, Card, Spinner, Alert } from 'react-bootstrap';
import { matchesApi, sportsApi } from '../services/api';
import MatchCard from './MatchCard';

const Dashboard = () => {
  const [liveMatches, setLiveMatches] = useState([]);
  const [upcomingMatches, setUpcomingMatches] = useState([]);
  const [sports, setSports] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetchDashboardData();
  }, []);

  const fetchDashboardData = async () => {
    try {
      setLoading(true);
      const [liveResponse, upcomingResponse, sportsResponse] = await Promise.all([
        matchesApi.getLiveMatches(),
        matchesApi.getUpcomingMatches(),
        sportsApi.getAllSports()
      ]);

      setLiveMatches(liveResponse.data);
      setUpcomingMatches(upcomingResponse.data.slice(0, 5)); // Show only first 5 upcoming matches
      setSports(sportsResponse.data);
    } catch (err) {
      setError('Failed to fetch dashboard data');
      console.error('Dashboard error:', err);
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <div className="loading-spinner">
        <Spinner animation="border" role="status">
          <span className="visually-hidden">Loading...</span>
        </Spinner>
      </div>
    );
  }

  if (error) {
    return (
      <Alert variant="danger" className="error-message">
        {error}
      </Alert>
    );
  }

  return (
    <Container fluid>
      <Row>
        <Col>
          <h1 className="section-title">🏆 Sports Dashboard</h1>
        </Col>
      </Row>

      {/* Sports Overview */}
      <Row className="mb-4">
        <Col>
          <Card>
            <Card.Header>
              <h5 className="mb-0">🏅 Available Sports</h5>
            </Card.Header>
            <Card.Body>
              <Row>
                {sports.map((sport) => (
                  <Col key={sport.id} md={3} className="mb-3">
                    <Card className="text-center h-100">
                      <Card.Body>
                        <div className="sport-icon">{sport.iconUrl || '🏆'}</div>
                        <Card.Title>{sport.name}</Card.Title>
                        <Card.Text className="text-muted small">
                          {sport.description}
                        </Card.Text>
                      </Card.Body>
                    </Card>
                  </Col>
                ))}
              </Row>
            </Card.Body>
          </Card>
        </Col>
      </Row>

      {/* Live Matches */}
      <Row className="mb-4">
        <Col>
          <Card>
            <Card.Header className="d-flex justify-content-between align-items-center">
              <h5 className="mb-0">🔴 Live Matches</h5>
              {liveMatches.length > 0 && (
                <span className="live-indicator">
                  {liveMatches.length} LIVE
                </span>
              )}
            </Card.Header>
            <Card.Body>
              {liveMatches.length > 0 ? (
                liveMatches.map((match) => (
                  <MatchCard key={match.id} match={match} />
                ))
              ) : (
                <div className="text-center text-muted py-4">
                  <h6>No live matches at the moment</h6>
                  <p>Check back later for live sports action!</p>
                </div>
              )}
            </Card.Body>
          </Card>
        </Col>
      </Row>

      {/* Upcoming Matches */}
      <Row>
        <Col>
          <Card>
            <Card.Header>
              <h5 className="mb-0">📅 Upcoming Matches</h5>
            </Card.Header>
            <Card.Body>
              {upcomingMatches.length > 0 ? (
                upcomingMatches.map((match) => (
                  <MatchCard key={match.id} match={match} />
                ))
              ) : (
                <div className="text-center text-muted py-4">
                  <h6>No upcoming matches scheduled</h6>
                  <p>Stay tuned for exciting matches!</p>
                </div>
              )}
            </Card.Body>
          </Card>
        </Col>
      </Row>
    </Container>
  );
};

export default Dashboard;
